import React from 'react';
import {
  BrowserRouter as Router, 
  Routes,
  Route
} from 'react-router-dom'
import Layout from './layout/Layout'
import Home from './components/pages/Home'

import './App.css';

function App() {
  return (
    <div>
    <Router>
      <Layout>
        <Routes>
          <Route path="/landingpage" element={<Home userName="test"/>}></Route>
        </Routes>
      </Layout>
    </Router>
  </div>
  );
}

export default App;
